// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;
pragma experimental ABIEncoderV2;

// REMIX
// import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/solc-0.6/contracts/token/ERC721/ERC721.sol";
// import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/solc-0.6/contracts/token/ERC20/ERC20.sol";
// import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/solc-0.6/contracts/math/SafeMath.sol";
// import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/solc-0.6/contracts/utils/Address.sol";

// TRUFFLE
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "../01_nft/OATImplementation.sol";
// import "../01_nft/OAThelper.sol";
import "../BaseRelayRecipient.sol";

// AUCTION CONTRACT FOR OAT
contract OATMKTImplementation is OwnableUpgradeable, BaseRelayRecipient{
    using SafeMathUpgradeable for uint256;
    using AddressUpgradeable for address;
    using CountersUpgradeable for CountersUpgradeable.Counter;
    CountersUpgradeable.Counter private _itemIds;
    address private oatAddress;
    OATImplementation private oat;

    event ItemListed(
        uint256 indexed itemindex,
        address nftowner, 
        uint256 indexed tokenId, 
        uint256 price,
        uint256 timestamp
    );

    event ItemUnlisted(
        uint256 itemid, 
        address nftowner, 
        uint256 tokenId, 
        uint256 timestamp
    );

    event ItemSold(
        uint256 itemid,
        address indexed nftowner,
        uint256 tokenId, 
        address indexed buyer,
        uint256 amount, 
        uint256 commissionAmount,
        uint256 timestamp
    );

    event priceUpdated(
        address admin, 
        uint256 itemId, 
        uint256 tokenId, 
        uint256 price
    );

    struct ItemDetails{
        address payable nftowner;
        uint256 price;
        uint256 tokenId;
        uint256 itemId;
        bool sold; 
        bool saletype;
        uint256 commission;
        uint256 timestamp;
    }
    mapping (uint256 => ItemDetails) Itemdetails; 


    /**
     * This function acts as the constructor
     *
     */
    function initialize(address _oatAddress, address _trustedForwarder) external initializer {
        __Ownable_init();
        require(_oatAddress.isContract());
        oatAddress = _oatAddress;
        trustedForwarder = _trustedForwarder;
        oat = OATImplementation(_oatAddress);
    }

    /**
     * Set Trusted Forwarder
     *
     * @param newTrustedForwarder - Address of Trusted Forwarder
     */
     function setTrustedForwarder(address newTrustedForwarder) external onlyAdmin {
        trustedForwarder = newTrustedForwarder;
    }

    /**
    * List an item on Marketplace
    *
    * @param _tokenId - Nft token ID
    * @param _price - Price of the token 
    * @param _commission - Commision on the NFT
    */
    function listNft(
        uint256 _tokenId, 
        uint256 _price, 
        uint256 _commission
    ) public returns (uint256){
        require(msg.sender == oat.ownerOf(_tokenId), "Artefy: Only owner can list item on market place");
        require(_price > 0, "Artefy: price must be greater than zero.");
        require(oat.getApproved(_tokenId) == address(this), "Artefy: You need to approve this contract");
        oat.transferFrom(msg.sender, address(this), _tokenId);
        // if (_commissionPer == 0){
        //     _commissionPer = 10;
        // }
        _itemIds.increment();
        uint256 _itemId = _itemIds.current();     
        ItemDetails memory item =
            ItemDetails({
                nftowner: msg.sender,
                tokenId: _tokenId,
                itemId: _itemId,
                price: _price,
                sold: false, 
                saletype: false, 
                commission: _commission, 
                timestamp: block.timestamp
            });

        Itemdetails[_itemId] = item;

        emit ItemListed(
            _itemId,
            msg.sender,
            _tokenId, 
            _price, 
            block.timestamp
        );
        return _itemId;
    }

    /**
    * UnList an item from Marketplace
    *
    * @param _tokenId - Nft token ID
    * @param _itemId - item id on Marketplace
    * @param _nftOwner - Original Owner of the NFT
    */
    function unlistNft(
        uint256 _tokenId, 
        uint256 _itemId,
        address _nftOwner
    ) public returns (bool){
        require(getAdmin(msg.sender) == true || msg.sender == owner(), "Admin access is not set. ");
        ItemDetails memory item = Itemdetails[_itemId];
        require (item.tokenId != 0 , "Artefy: Item does not exist on Marketplace.");
        require(oat.ownerOf(_tokenId) == address(this), "Artefy: Only a listed item can be unlisted from the market place");
        require(item.tokenId == _tokenId, "Artefy: This token Id is not listed aganist this item Id");
        require(_nftOwner == item.nftowner, "Artefy: Owner of the nft is not correct");

        oat.transferFrom(address(this), item.nftowner, _tokenId);
        delete Itemdetails[_itemId];
        emit ItemUnlisted(
            _itemId, 
            msg.sender, 
            _tokenId, 
            block.timestamp
        );
        return true;
    }


    // One security risk, any user can send the amount of his own choice
    // If we don't save the amount... Amount can 

    /**
    * Sell an item 
    *
    * @param _tokenId -- Id of token to sell
    * @param _itemId -- Item Id on marketplace to sell
    * @param adminAccount -- Admin account to send commision
    */
    function sellItem(
        uint256 _tokenId,
        uint256 _itemId,  
        address adminAccount
    ) public payable {
        ItemDetails memory item = Itemdetails[_itemId];
        uint256 _amount = item.price;
        require (item.tokenId != 0 , "Artefy: Item does not exist on Marketplace.");
        require(item.sold == false, "Artefy: Item is already sold.");
        require(oat.isAdmin(adminAccount), "Artefy: Admin account is not correct.");
        require(_amount == msg.value, "Artefy: Amount sent is not enough to buy NFT.");
        require(oat.ownerOf(_tokenId) == address(this), "Artefy: Item is not listed on Market Place."); 
        require(_tokenId == item.tokenId, "Artefy: Token Id or Item Id maybe incorrect.");

        // uint256 commision = _amount.mul(item.comPercentage).div(100);
        uint256 commission = item.commission;
        // admin account to send commission....
        (bool sentadmin,) = adminAccount.call{value: commission}("");
        require(sentadmin, "Artefy: Failed to send amount to Admin."); // Tranfering Matic value as well.

        uint256 amount = _amount.sub(commission);
        // Transferring the remaining amount to nft owner
        (bool sent,) = item.nftowner.call{value: amount}("");
        require(sent, "Artefy: Failed to send amount."); // Tranfering Matic value as well. 
        oat.safeTransferFrom(address(this), msg.sender, _tokenId);

        emit ItemSold(_itemId, item.nftowner, _tokenId, msg.sender, _amount, commission, block.timestamp);
        Itemdetails[_itemId].sold = true;

    }

    /**
    * Sell an item 
    *
    * @param _tokenId -- Id of token to sell
    * @param _itemId -- Item Id on marketplace to sell
    */
    function sellItemFiat(
        uint256 _tokenId,
        uint256 _itemId, 
        address _buyer  
    ) public returns (bool){
        require(getAdmin(msg.sender) == true || msg.sender == owner(), "Admin access is not set. ");
        ItemDetails memory item = Itemdetails[_itemId];
        require (item.tokenId != 0 , "Artefy: Item does not exist on Marketplace.");
        require(item.sold == false, "Artefy: Item is already sold.");
        require(oat.ownerOf(_tokenId) == address(this), "Artefy: Item is not listed on Market Place."); 
        require(_tokenId == item.tokenId, "Artefy: Token Id or Item Id maybe incorrect.");

        oat.safeTransferFrom(address(this), _buyer, _tokenId);
        Itemdetails[_itemId].sold = true;
        emit ItemSold(_itemId, item.nftowner, _tokenId, _buyer, item.price, item.commission, block.timestamp);
    }

    /**
    *  function to set the item price before sell
    * 
    * @param _amount - price of the token
    * @param _itemId - Item id to set the price
    * @param _tokenId - token id of the item
    * @param _commission - Commission according to new price
    */
    function setPrice(
        uint256 _amount, 
        uint256 _itemId, 
        uint256 _tokenId,
        uint256 _commission
    ) public {
        require(getAdmin(msg.sender) == true || msg.sender == owner(), "Admin access is not set. ");
        ItemDetails memory item = Itemdetails[_itemId];
        require (item.tokenId != 0 , "Artefy: Item does not exist on Marketplace.");
        require(oat.ownerOf(_tokenId)== address(this), "Item is not listed on Market Place."); 
        require(_tokenId == item.tokenId, "Token Id or Item Id maybe incorrect.");
        Itemdetails[_itemId].price = _amount;
        Itemdetails[_itemId].commission = _commission;
        emit priceUpdated(msg.sender, _itemId, _tokenId, _amount);
    }

    /**
    * Return admin
    */
    function getAdmin(address admin) public view returns (bool){
        return oat.isAdmin(admin);
    }

    /**
    * Get total listed items count
    */
    function getTotalCount() public view returns (uint256){
        return _itemIds.current();
    }

    /**
    * Get listed items by owner address
    * 
    * @param _nftowner -- owner of NFT to get listed items
    */
    function getListedByOwner(
        address _nftowner
    ) public view returns(ItemDetails [] memory){
        ItemDetails[] memory result = new ItemDetails[](getCountByOwner(_nftowner));
        uint256 index;
        uint256 count = 0;
        for (index = 1; index <= _itemIds.current() ; index++) {
            ItemDetails memory item = Itemdetails[index];
            if (!(item.nftowner == address(0)) && item.sold == false){
                if(item.nftowner == _nftowner){
                    result[count] = item;
                    count++;
                }
            }
        }
        return result;
    }


    /**
    * Get listed item details by item Id
    * 
    * @param _itemId -- Item Id to get details
    */
    function getListedById(
        uint256 _itemId
    ) public view returns(ItemDetails memory){
       return Itemdetails[_itemId];
    }

    /**
    * Get count of listed
    */
    function getCount() public view returns (uint256){
        uint256 index = 0;
        uint256 count = 0;
        for (index = 0; index <= _itemIds.current() ; index++) {
            ItemDetails memory item = Itemdetails[index];
            if (!(item.nftowner == address(0)) && item.sold == false){
                count++;
            }
        }
        return count;
    }

    /**
    * Get count of listed
    *
    * @param _owneraddress -- address of nft owner to get listed item
    */
    function getCountByOwner(
        address _owneraddress
    ) public view returns (uint256){
        uint256 index = 0;
        uint256 count = 0;
        for (index = 0; index <= _itemIds.current() ; index++) {
            ItemDetails memory item = Itemdetails[index];
            if (!(item.nftowner == address(0)) && item.sold == false){
                if(item.nftowner == _owneraddress){
                    count++;
                }
            }
        }
        return count;
    }


    /**
    * Get the list of all listed items
    */
    function getListed(
    ) public view returns(ItemDetails [] memory) {
        uint256 index;
        uint256 count = 0;
        ItemDetails[] memory result = new ItemDetails[](getCount());
        for (index = 0; index <= _itemIds.current() ; index++) {
            ItemDetails memory item = Itemdetails[index];
            if (!(item.nftowner == address(0)) && item.sold == false){
                result[count] = item;
                count++;
            }
        }
        return result;
    }



    /**
     * returns the message sender
     */
     function _msgSender()
     internal
     view
     override(ContextUpgradeable, BaseRelayRecipient)
     returns (address payable)
        {
            return BaseRelayRecipient._msgSender();
        }

     /**
     * Throws if called by any account other than the Admin.
     */
     modifier onlyAdmin() {
        require(
            oat.isAdmin(_msgSender()) || _msgSender() == owner(),
            "Caller does not have Admin Access"
        );
        _;
    }


}

